import React from "react";
function Cards(props)
{
    return(
        <>
            <div className="cards col-sm-6 center">
            <div className="card">
            <img  src={props.imgsrc} alt="season profile photo"></img>
            <div className="card-info">
                <span className="card-category">{props.title}</span>
            <h3 className="Title"> {props.SName}</h3>
            <a href={props.refrence} target="_blank">
                <button> Watch Now</button>
            </a>
        
            </div>
            </div>
        
            </div>
        </>

    );
}
export default Cards;
